import Footer from '../components/Footer';
const Container = styled.div`
  
`;
const Product = () => {
  return (
    <Container>
      <Announcement/>
      <Navbar/>
      <Wrapper>
        <ImageContainer>
          <Image src="" />

          
        </ImageContainer>
        <InfoContainer>
          <Title></Title>
          <Desc></Desc>
        </InfoContainer>
      </Wrapper>
      <NewsLetter/>
      <Footer/>
    </Container>
  )
}

export default Product
